import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Card } from './components/card'
import { Header } from './components/Header';
import { Footer } from './components/Footer';

function App() {
  return (

    <React.Fragment>
      <Header/>
      <div>
        Hello World
        <Card id={1}
          paragrafo='NExt'
          details='A aceleração da sua fintech'
        />
        <Card id={2}
          paragrafo='LIFT'
          details='Aceleração'
        />
      </div>
      <Footer/>
    </React.Fragment>

  );
}

export default App;
